import { createRouter, createWebHistory } from 'vue-router';
import FiveDayForecast from '@/components/FiveDayForecast.vue'; // Import the component here

const routes = [
  {
    path: '/5day',
    name: 'FiveDayForecast',
    component: FiveDayForecast, // Reference the imported component here
    props: true, // Allows passing props via the route
  },
  // other routes can go here...
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
